import React, { useState } from 'react';
import { ShoppingCartOutlined, MenuOutlined } from '@ant-design/icons';
import '../../index.css';

const MyNavbar = () => {

    const [menu, setMenu] = useState(false);

    const toggleMobileMenu = () => {
        setMenu(true);
    }

    const mobileMenu = () => {
        if(menu) {
            return (
                <ul className="nav-links" style={{display: 'flex'}}>
                    <li>
                        <a href="/">Home</a>
                    </li>
                    <li>
                        <a href="/">Products</a>
                    </li>
                    <li>
                        <a href="/">About</a>
                    </li>
                </ul>
            )
            
        } else {
            return(
                <ul className="nav-links" style={{display: 'none'}}>
                    <li>
                        <a href="/">Home</a>
                    </li>
                    <li>
                        <a href="/">Products</a>
                    </li>
                    <li>
                        <a href="/">About</a>
                    </li>
                </ul>
            )
            
        }
    }

    return (
        <div className="navbar">
            <div className="nav-logo">
                <a href="/">Bio Market</a>
            </div>
            <ul className="nav-links">
                <li>
                    <a href="/">Home</a>
                </li>
                <li>
                    <a href="/">Products</a>
                </li>
                <li>
                    <a href="/">About</a>
                </li>
                <li>
                    <a href="/"><ShoppingCartOutlined className="shopping-cart"/></a>
                </li>
            </ul>
            {mobileMenu}
            <a href="/"><ShoppingCartOutlined className="shopping-cart-mobile"/></a>
            <button onClick={toggleMobileMenu}><MenuOutlined className="mobile-navbar" /></button>
        </div>
    );
}
 
export default MyNavbar;
